#include "multi_array_dimensions.h"namespace pps {namespace multi_array {dimensions::dimensions(){}dimensions::dimensions(const dimensions& p_dimensions): m_data(p_dimensions.m_data){}dimensions& dimensions::operator=(const dimensions& p_dimensions){	if(&p_dimensions == this)		return *this;	m_data = p_dimensions.m_data;	return *this;}dimensions& dimensions::operator[](const std::size_t& p_dimension){	m_data.push_back(p_dimension);	return *this;}}}